import './App.css';
import CoffeeGrid from './components/BeansGrid';
import BeansOfTheDay from './components/BeansOfTheDay';
import beans from './data/AllTheBeans.json';

function App() {
  return (
    <div className="coffee-page">
      {/* Beans of the Day banner */}
      <BeansOfTheDay beans={beans} />
      <CoffeeGrid />
    </div>
  );
}

export default App;
